INSERT INTO `product` VALUES (1,_binary '\0','Điện thoại iPhone 16 Test thành công',25990000,35,1,15,NULL,''),(2,_binary '\0','Điện thoại iPhone 16',25990000,43,1,7,NULL,''),(3,_binary '','Điện thoại iPhone 16 test',25990000,50,1,0,NULL,'test'),(4,_binary '','Điện thoại iPhone 16 test',25990000,50,1,0,NULL,'test1'),(5,_binary '','test',2000,1,3,0,NULL,'test'),(6,_binary '','test',1000,1,3,0,NULL,'1'),(7,_binary '\0','test',10000,510,3,107,NULL,'tesst'),(8,_binary '\0','Máy lạnh Nagakawa Inverter 1 HP NIS-C09R2T28',5290000,10,7,0,NULL,'Máy lạnh Nagakawa Inverter 1 HP NIS‑C09R2T28 – Giải pháp làm mát thông minh và tiết kiệm cho phòng dưới 15 m².\n\nMột lựa chọn đáng cân nhắc cho phòng ngủ, phòng làm việc hoặc phòng khách nhỏ với diện tích dưới 15 m² (30–45 m³), model này nổi bật nhờ hiệu năng lạnh tốt, nhiều tiện ích và giá cả hợp lý.'),(9,_binary '\0','Tủ lạnh LG Inverter 315 lít LTB31BLM',10640000,10,6,0,NULL,'Tủ lạnh LG Inverter 315 lít LTB31BLM mới 2024 là sản phẩm hiện đại, kết hợp giữa công nghệ tiên tiến và thiết kế tinh tế . Với dung tích 315 lít, sản phẩm này đáp ứng tốt nhu cầu lưu trữ thực phẩm của các gia đình từ 3-5 thành viên.'),(10,_binary '\0','Máy giặt sấy LG Inverter giặt 10 kg - sấy 6 kg FV1410D4M1',14490000,10,5,0,NULL,'Tính năng chính\n\nĐộng cơ Direct Drive™ - Bảo hành 10 năm\nTurboWash™ - Tiết kiệm thời gian\nSteam+™ - Ít nếp nhăn và vệ sinh hơn\nAIDD™ - Bảo vệ vải\nYên tĩnh - Hiệu quả năng lượng Loại A'),(11,_binary '','Máy lạnh LG Inverter 1 HP IDC09M1',11590000,0,7,21,NULL,'Đặc điểm nổi bật\n\nCông suất 1 HP làm lạnh hiệu quả, phù hợp cho phòng dưới 15m².\nĐảo gió 4 chiều giúp hơi lạnh lan tỏa đồng đều.\nCánh vẫy kép Dual Vane tối ưu hướng gió, đem lại cảm giác dễ chịu ở mọi nhiệt độ.\nChế độ kiểm soát độ ẩm giúp duy trì luồng không khí ở mức phù hợp.'),(12,_binary '','test',10000,0,3,2,NULL,''),(13,_binary '','ấcdasdsad',1000,0,9,1,NULL,'1'),(14,_binary '','test',2000,0,16,3,NULL,''),(15,_binary '','test',1000,0,16,1,NULL,'1');
